// Get the OpenAI response text
const openAIResponse = {{queries.f338b8d5-7838-4b4a-a1b9-da6ad6536ebc.data}}

let responseText = '';

// Extract text from OpenAI response structure
if (openAIResponse.output && 
    openAIResponse.output[0] && 
    openAIResponse.output[0].content && 
    openAIResponse.output[0].content[0]) {
  responseText = openAIResponse.output[0].content[0].text;
}

// Return empty if no text found
if (!responseText) {
  return [{
    json: {
      issue_number: 0,
      description: 'No response text found'
    }
  }];
}

// Extract only lines that start with "- Issue X:" pattern
const issuePattern = /-\s*Issue\s+(\d+):\s*(.+?)(?=\n|$)/gi;
const issues = [];

let match;
while ((match = issuePattern.exec(responseText)) !== null) {
  issues.push({
    json: {
      issue_number: parseInt(match[1]),
      description: match[2].trim()
    }
  });
}

// Return extracted issues or empty result
return issues.length > 0 ? issues : [{
  json: {
    issue_number: 0,
    description: 'No issues found in response'
  }
}];
